        {
            value: '300',
            title: 'Incompleted Students'
        },
        {
            value: '20',
            title: 'Completed Groups'
        },
        {
            value: '35',
            title: 'Incompleted Groups'
        }
    ],
    
    revenueByMonths: {
        labels: ['Major1', 'Major2', 'Major3', 'Major4', 'Major5', 'Major6', 'Major7', 'Major8', 'Major9', 'Major10'],
        data: [250, 200, 300, 280, 100, 220, 310, 190, 200, 120]
    }
}

export default data
